CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_FetchCieByPrix`()
BEGIN

select distinct(abrev) from action a
inner join marche m on m.nom = a.abrev
inner join config on config.id = 1


where nomCie <> '' and nomCie <> '-'
AND m.prix > config.debut
AND m.prix < config.fin


group by abrev;

END ;;
