CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_insertIntoTicker`(in nomCourt varchar(255)
                                                                 ,in nomLong varchar(255))
BEGIN

  DECLARE i INT;
  SELECT COUNT(*) INTO i FROM `stock`.`action` WHERE abrev = nomCourt ; 

  IF (i=0) THEN

    insert into `stock`.`action` (abrev, nomCie)
      values (nomCourt, nomLong);


  ELSE

     UPDATE `stock`.`action`
      SET nomCie = nomLong
      WHERE nomCourt = abrev;
  END IF;



END ;;
